function PopUpShow(){$("#pop-up-form").fadeIn()}function PopUpHide(){$("#pop-up-form").fadeOut()}function FaqHide(){$(".faq-hidden-text").hide()}function FaqOpen(){$(this).siblings(".faq-hidden-text").toggle()}function SendForm(){var e={};$("#form").find("input, select, #count").map((function(){e[this.name]=$(this).val()})),console.log(e)}$(document).ready((function(){PopUpHide(),$(".desktop-carousel").slick({autoplay:!0,arrows:!1,dots:!0,slidesToShow:3,adaptiveHeight:!0,centerMode:!1,mobileFirst:!0,responsive:[{breakpoint:700,settings:{slidesToShow:1,centerMode:!0}},{breakpoint:1100,settings:{slidesToShow:3,centerMode:!1}},{breakpoint:550,settings:{slidesToShow:1,centerMode:!1}}]}),FaqHide(),$(".calendar").datepicker({autoClose:!0})})),$("#pop-up").click(PopUpShow),$("#pop-up-close").click(PopUpHide),$(".faq-toggle").click(FaqOpen),$("#count-minus").click((function(){var e=$("#count"),o=parseInt(e.val())-1;return o=o<1?1:o,e.val(o),!1})),$("#count-plus").click((function(){var e=$("#count");return e.val(parseInt(e.val())+1),!1})),$(".submit").click(SendForm);